            bmiCalculator: output,
            heightVal: 'Underweight',
            height: e1.target.value
          });
        } else if (output >= 18.5 && output <= 25) {
          this.setState({
            bmiCalculator: output,
            heightVal: 'Normal',
            height: e1.target.value
          });
        } else if (output >= 25 && output <= 30) {
